		var keyUnpressed = true;
		
		this.dog.addEventListener("click", dogClick.bind(this));
		function dogClick() {
			bcoins = bcoins.plus(bpc);
			xpNow = xpNow.plus(bpc);
			bcoinsall = bcoinsall.plus(bpc);
			if (mood.lt(maxmood)) {
				mood = mood.plus(comboPlus);
			}
		
			window.focus();
			PokiSDK.gameplayStop();
			gamePlay = false;
		
			PokiSDK.commercialBreak().then(() => {
				PokiSDK.gameplayStart();
				gamePlay = true;
			});
		}
		
		window.addEventListener("keydown", doKeyDown.bind(this));
		function doKeyDown(e) {
			if (e.keyCode == 32 && gamePlay && keyUnpressed) {
				dogClick();
				keyUnpressed = false;
			}
		}
		
		window.addEventListener("keyup", doKeyUp.bind(this));
		function doKeyUp(e) {
			if (e.keyCode == 32) {
				keyUnpressed = true;
			}
		}
		
